'''''Éarendel''''', was the name of [[Éadwine]]'s ship. The ship, along with Éadwine, disappeared in the year [[Seventh Age 878|878 AD]], and no trace of both was ever found.<ref>{{SD|2d}}</ref>

'''''The Éarendel''''' was the name of a ship in [[1947]], on which [[Edwin Lowdham|Edwin]], along with three other sailors, went off into [[wikipedia:Atlantic ocean|Atlantic]] and never returned.<ref>{{SD|2d}}, "Night 66"</ref>

